import {vars} from '../data'
import {MainVar} from'./MainVar'

export function Main(){
    
    return(
        <div className="main">
          <MainVar title={data[0].title} text={data[0].text}/>
          <MainVar title={data[1].title} text={data[1].text}/>
          <MainVar title={data[2].title} text={data[2].text}/>
          <MainVar title={data[3].title} text={data[3].text}/>
        </div>
    )
}
